import React, { Component } from "react";
import "./FeatureQueen.css";

class FeatureQueen extends Component {

    render(){
        return (
            <div className="wrapper featureWrapper">
                <h2>{this.props.feature.name}</h2>
                <p className="quote">{this.props.feature.quote}"</p>
                <div className="featureImageContainer">
                    <img src={this.props.feature.image_url} alt=""/>
                </div>

                <div className="featureInfoPanel">
                    {this.props.feature.seasons.map(season => {
                        return (
                            <div className="seasonStats">
                                <div className="season">
                                    <div className="seasonNumber">
                                        <p className="seasonNumber">{season.seasonNumber}</p>
                                    </div>
                                    <p className="season">Season</p>
                                </div>
                                <div className="place">
                                    <div className="placeNumber">
                                        <p className="placeNumber">{season.place}</p>
                                    </div>
                                    <p className="season">Place</p>
                                </div>
                            </div>
                        )
                    })}
                </div>

                    {/* <div className="seasonStats">
                        <div className="season">
                            <div className="seasonNumber">
                                <p className="seasonNumber">{this.props.feature.seasons[0].seasonNumber}</p>
                            </div>
                            <p className="season">Season</p>
                        </div>
                        <div className="place">
                            <div className="placeNumber">
                                <p className="placeNumber">{this.props.feature.seasons[0].place}</p>
                            </div>
                            <p className="season">Place</p>
                        </div>
                    </div> */}


            </div>
        )
    }
}

export default FeatureQueen;
